import React, { useState } from "react";
import "../../styles/HomePage/Services.css";

const specialties = [
  { name: "Dentist", image: "https://cdn-icons-png.flaticon.com/512/3039/3039435.png" },
  { name: "Dermatologist", image: "https://cdn-icons-png.flaticon.com/512/1055/1055672.png" },
  { name: "Pediatrician", image: "https://cdn-icons-png.flaticon.com/512/3448/3448610.png" },
  { name: "Cardiologist", image: "https://cdn-icons-png.flaticon.com/512/3457/3457536.png" },
  { name: "Gynecologist", image: "https://cdn-icons-png.flaticon.com/512/2750/2750721.png" },
  { name: "Neurologist", image: "https://cdn-icons-png.flaticon.com/512/1950/1950705.png" },
  { name: "Orthopedic", image: "https://cdn-icons-png.flaticon.com/512/810/810539.png" },
  { name: "General Physician", image: "https://cdn-icons-png.flaticon.com/512/3050/3050525.png" },
  { name: "Urology", image: "https://cdn-icons-png.flaticon.com/512/3421/3421730.png" },
  { name: "Sexology", image: "https://cdn-icons-png.flaticon.com/512/1256/1256650.png" },
  { name: "Stomach and Digestion", image: "https://cdn-icons-png.flaticon.com/512/620/620851.png" },
];

const Services = () => {
  const [expanded, setExpanded] = useState(false);

  const toggleExpansion = () => {
    setExpanded(!expanded);
  };

  return (
    <div className="services-section">
      <h2 className="services-title">Popular Specialties</h2>
      <div className="services-container">
        {specialties.slice(0, expanded ? specialties.length : 5).map((specialty, index) => (
          <div className="service-card" key={index}>
            <img src={specialty.image} alt={specialty.name} className="service-icon" />
            <h3>{specialty.name}</h3>
          </div>
        ))}
      </div>
      <div className="expand-button">
        {!expanded ? (
          <button onClick={toggleExpansion}>Show More ></button>
        ) : (
          <button onClick={toggleExpansion}>Show Less </button>
        )}
      </div>
    </div>
  );
};

export default Services;
